pragma solidity ^0.5.10;

import "../multisig/Multisig.sol";
import "../multisig/Proxy.sol";

import "./Factory.sol";

/**
* @title FactoryWrapper
* @author Disberse LTD
* @notice A wrapper contract for atomically deploying and intializing
* delegatecall proxies. Tightly coupled with both Proxy.sol and Multisig.sol
*/
contract FactoryWrapper is AuthChecker {

    /////
    // Constant data
    /////

    // default for Geth private chains
    uint public constant CHAIN_ID = 1337;

    /////
    // State data
    /////

    Factory public factory;         // the contract factory
    address public defaultTarget;   // the target address for deployed proxies
    address public defaultGuard;    // the guard address for deployed proxies
    address public defaultGrave;    // the grave address for deployed proxies

    /////
    // Events
    /////

    event DeployProxy(
        address indexed sender,         // sender of the deploy tx
        address indexed deployedAddr,   // new contract address
        bytes32 indexed salt            // salt used to deploy contract
    );


    /////
    // Constructor
    /////

    /**
    * @dev Constructor
    * @param _factory The address of the contract factory to "wrap"
    * @param _defaultTarget The target address to pass to the deployed proxies
    * @param _defaultGuard The guard address to pass to the deployed proxies
    * @param _defaultGrave The grave address to pass to the deployed proxies
    */
    constructor(
        address _guard,
        address _factory,
        address _defaultTarget,
        address _defaultGuard,
        address _defaultGrave
    )
        public
        AuthChecker(_guard)
    {
        factory = Factory(_factory);
        defaultTarget = _defaultTarget;
        defaultGuard = _defaultGuard;
        defaultGrave = _defaultGrave;
    }


    /////
    // Public / external functions
    /////

    /**
    * @dev Calls `deploy` on the contract factory, then atomically calls
    * `setup` on the deployed proxy
    * @param _salt The create2 salt for the contract factory
    * @param _threshold The signer threshold for the multisig (proxy)
    * @param _signers The initial signers for the multisig (proxy)
    * @return The address of the deployed proxy
    */
    function deployProxy(
        bytes32 _salt,
        uint256 _threshold,
        address[] memory _signers
    )
        public
        onlyAuthorized
        returns (address)
    {
        address payable proxyAddr = factory.deploy(_salt);
        Proxy proxy = Proxy(proxyAddr);

        bytes memory setupData = _encodeSetupData(_threshold, _signers);

        proxy.setup(setupData, defaultTarget);

        // sanity checks. We never want to leave this function with an
        // uninitialized proxy
        Multisig proxyWithTarget = Multisig(proxyAddr);
        require(proxyWithTarget.target() == defaultTarget, "proxy-target-not-set");
        require(proxyWithTarget.domainSeparator() != bytes32(0), "proxy-domainSeparator-not-set");

        emit DeployProxy(msg.sender, proxyAddr, _salt);
        return proxyAddr;
    }

    /**
    * @dev Changes the default target address
    * @param _defaultTarget The new default target address
    */
    function setDefaultTarget(address _defaultTarget) public onlyAuthorized {
        defaultTarget = _defaultTarget;
    }

    /**
    * @dev Changes the default guard address
    * @param _defaultGuard The new default guard address
    */
    function setDefaultGuard(address _defaultGuard) public onlyAuthorized {
        defaultGuard = _defaultGuard;
    }

    /**
    * @dev Changes the default grave address
    * @param _defaultGrave The new default grave address
    */
    function setDefaultGrave(address _defaultGrave) public onlyAuthorized {
        defaultGrave = _defaultGrave;
    }

    /////
    // Internal functions
    /////

    /**
    * @dev Encodes the _forwardData for the Multisig `setup` function for
    * inclusion in the call to the Proxy `setup` function
    * @param _threshold The signer threshold for the multisig (proxy)
    * @param _signers The initial signers for the multisig (proxy)
    */
    function _encodeSetupData(uint _threshold, address[] memory _signers)
        internal
        view
        returns (bytes memory)
    {
        return abi.encodeWithSelector(
            // the destination address does not change the function selector
            Multisig(address(0)).setup.selector,
            _threshold,
            CHAIN_ID,
            _signers,
            defaultGrave,
            defaultGuard
        );
    }

}

